import React, {Component} from 'react'
import Exit from './x.png'

class PopUp2 extends Component{
    render(){
        return(
            <div className="popup">
                 <div class="row">
                    <div class="col-lg-6 col-md-6 col-sm-12 photo">
                    <img onClick={this.props.closePopup} src={Exit} className="back-button" />

                    </div>
                    <div class="col-lg-6 col-md-6 col-sm-12">

                    </div>
                </div>
            </div>

        )
    }
}

export default PopUp2;
